package Practice;

public class ProductOfOneToFive {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num=1;
		int product=1;
		 
		while(num<=5)
		{
			product=product*num;
			num++;
		}
		
         System.out.println(product);
	}


	

	}


